import {
    Box,
    createTheme,
    Tabs,
    TextField,
    ThemeProvider,
    Typography,
  } from "@mui/material";
  import React from "react";
  import AppBarTop from "../components/AppBarTop";
  import { PADDING } from "../constants/Padding";
  import { THEME } from "../constants/Theme";
  import SearchIcon from "@mui/icons-material/Search";
  import styled from "@emotion/styled";
  import Tab from "@mui/material/Tab";
  import { useTheme } from "@emotion/react";
  import SwipeableViews from "react-swipeable-views";
  import PropTypes from "prop-types";
  import NotificationsNoneOutlinedIcon from "@mui/icons-material/NotificationsNoneOutlined";

  const themeColor = createTheme({
    palette: {
      primary: {
        main: THEME.GREEN_PRIMARY,
      },
    },
  });

  const CustomTab = styled(Tab)({
    textTransform: "none",
    color: THEME.GREY_PRIMARY,
    fontWeight: 600,
    fontSize: "12px",
  });

  function TabPanel(props) {
    const { children, value, index, ...other } = props;

    return (
      <div
        role="tabpanel"
        hidden={value !== index}
        id={`full-width-tabpanel-${index}`}
        aria-labelledby={`full-width-tab-${index}`}
        {...other}
      >
        {value === index && (
          <Box sx={{ p: 3 }}>
            <Typography>{children}</Typography>
          </Box>
        )}
      </div>
    );
  }

  TabPanel.propTypes = {
    children: PropTypes.node,
    index: PropTypes.number.isRequired,
    value: PropTypes.number.isRequired,
  };

  function Profile() {
    const [searchLoc, setSearchLoc] = React.useState("");
    const [chooseMap, setChooseMap] = React.useState(false);
    const [value, setValue] = React.useState(0);
    const theme = useTheme();

    const handleChange = (event, newValue) => {
      setValue(newValue);
    };

    const handleChangeIndex = (index) => {
      setValue(index);
    };

    return (
      <Box
        sx={{
          width: "100%",
          display: "flex",
          flexDirection: "column",
          justifyContent: "flex-start",
          alignItems: "center",
        }}
      >
       <Box sx={{ display: "flex", justifyContent: "space-between" }}>
          <Box
            sx={{
              display: "flex",
              flexDirection: "column",
            }}
          >
            <Box>
              <Typography sx={{ color: THEME.GREY_PRIMARY, fontSize: "12px" }}>
                Profil
              </Typography>
            </Box>
            <Box sx={{ display: "flex" }}>
              <Box>
                <Typography
                  sx={{ fontWeight: "bold", fontSize: 16, marginTop: "6px" }}
                >
                  KEPUTIH
                </Typography>
              </Box>
              <Box sx={{ marginLeft: "9px" }} variant="raised">
                <Typography
                  sx={{
                    fontWeight: "bold",
                    fontSize: "12px",
                    color: THEME.GREEN_PRIMARY,
                    marginTop: "10px",
                    "&:hover": {
                      cursor: "pointer",
                    },
                  }}

                >
                  Ubah
                </Typography>
              </Box>
            </Box>
          </Box>
          <Box>
            <NotificationsNoneOutlinedIcon
              sx={{
                color: THEME.GREEN_PRIMARY,
                fontSize: "22px",
                "&:hover": {
                  cursor: "pointer",
                },
              }}
            />
            <CommentOutlinedIcon
              sx={{
                color: THEME.GREEN_PRIMARY,
                marginLeft: "15px",
                fontSize: "20px",
                "&:hover": {
                  cursor: "pointer",
                },
              }}
            />
          </Box>
        </Box>
      </Box>
    );
  }

  export default Profile;
